import React from 'react';
import './App.css';
// import Blog from './templates/Blog';
import Header from './templates/Header';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  
import NovoPost from './templates/Newposts.js'
import Blog from './templates/Blog.js';
import Contato from './templates/Contato.js'
import Produtos from './templates/Posts.js';


function App() {
  return (
    <Router>
    <div className="App">
      <Header/>
      <main className="Main">
        <Routes>
          <Route path="/Home" element={<Blog />} />
          <Route path="/Posts" element={<Produtos />} />
          <Route path="/Novo Post" element={<NovoPost />} />
          <Route path="/Contato" element={<Contato />} />
        </Routes>
        <div className="Content">

        </div>
      </main>
    </div>
    </Router>
  );
}

export default App;
